import axios from "axios";

export const signUpUser = (username, email, password, roles) => {
  axios
    .post("http://localhost:8080/api/auth/signup", {
      username: username,
      email: email,
      password: password,
      roles: roles,
    })
    .then((response) => {
      console.log(response);
    })
    .catch((error) => {
      console.log(error);
    });
};
